function applyPosition1() {
  let screenW = window.innerWidth;
  let screenH = window.innerHeight ;

  const rect = drawingArea.getBoundingClientRect();
  const divW = rect.width + 100;
  const divH = rect.height + 100;

  const centerX = ((screenW - divW) / 2).toFixed(2); // this is LEFT
  const centerY = ((screenH - divH) / 2).toFixed(2); // this is TOP

  const leftString = `${centerX}px`;
  const topString = `${centerY}px`;

  drawingArea.style.right = leftString; // correct
  drawingArea.style.bottom = topString;   // correct
}


function resetTransform() {
    const baseWidth1 = 980; 
    const currentWidth1 = window.innerWidth;
    let zoom2 = currentWidth1 / baseWidth1;
    zoom2 = Math.max(0.30, Math.min(1.50, zoom2));
    zoomInput.value = zoom2.toFixed(2);
    rotateInput.value = 0;
    scale = 1;
    rotation = 0;
    offsetX = 0;
    offsetY = 0;
    updateTransform();
    applyPosition1();
}

