function buildStackXML() {
    const stack = layers.map((layer, i) => {
        return `<layer name="${layer.name}" src="data/layer${i}.png" x="${layer.x}" y="${layer.y}" opacity="${layer.opacity}" visibility="${layer.visible ? 'visible' : 'hidden'}" />`;
    }).reverse().join("\n");

    return `<?xml version="1.0" encoding="UTF-8"?>
<image w="600" h="400" version="0.0.1" xmlns="http://www.freedesktop.org/standards/openraster">
${stack}
</image>`;
}

async function downloadORA() {
    if(layers.length <= 0){
        divEffectsConfig.txt_message.text = "No layer found!";
        divEffectsConfig.mainmsg.backgroundColor = "rgba(157, 81, 97, 0.7)";
        divEffectsConfig.icons_alert.text ="warning";
        divEffectsConfig.mainmsg.borderColor = "red";
        divEffectsConfig.mainmsg.dispay = "flex";
        divEffectsConfig.isdisplayed = "true"
        applyMessageData(divEffectsConfig);
        return;
    }
    const zip = new JSZip();
    zip.file("mimetype", "image/openraster");
    const dataFolder = zip.folder("data");
  
    for (let i = 0; i < layers.length; i++) {
      const canvas = layers[i];
  
      if (!(canvas instanceof HTMLCanvasElement)) {
        console.warn(`Layer ${i} is not a canvas, skipping.`);
        continue;
      }
  
      console.log(`Processing layer ${i}...`);
  
      // Await blob creation per canvas
      const blob = await new Promise((resolve, reject) => {
        canvas.toBlob(blob => {
          if (blob) {
            resolve(blob);
          } else {
            reject(new Error(`Failed to get blob for layer ${i}`));
          }
        }, "image/png");
      });
  
      dataFolder.file(`layer${i}.png`, blob);
      console.log(`Added layer ${i} blob to zip.`);
    }
  
    const content = await zip.generateAsync({ type: "blob" });
    const link = document.createElement("a");
    link.href = URL.createObjectURL(content);
    link.download = "project.ora";
    link.click();


    divEffectsConfig.txt_message.text = "Exported succesfully!";
    divEffectsConfig.mainmsg.backgroundColor = "rgba(89, 187, 82, 0.7)";
    divEffectsConfig.icons_alert.text ="check_circle";
    divEffectsConfig.mainmsg.borderColor = "green";
    divEffectsConfig.mainmsg.dispay = "flex";
    applyMessageData(divEffectsConfig);
  }
  
  
